Do I put on makeup everyday?? No. 😂 But if i have the chance, this is for sure my go to! I timed it and it takes me 10 min tops. Hope you find something new you want to try! This look is pretty standard for me, I just try to incorporate new products when I can! I know majority of this is expensive products so ask for samples before committing if you’re unsure!! What IGTV should I do next?? Stay tuned for a new YT beauty vid tomorrow! ⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀
